import ReactDOM from 'react-dom'
import './index.css'
import myComponent from './myComponent'

class Index extends React.Component {
  render() {
    return (
      <fragment>
        <div>Hello</div>

        <myComponent value="3000" />
      </fragment>
    )
  }
}

ReactDOM.render(<Index />, document.getElementById('root'))
